import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'tachyons';
import Card from './Card.js';
import robots from './robots.js';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
   <Card n={robots[0].name} e = {robots[0].email} i = {robots0[0].id} />
   <Card n={robots[1].name} e = {robots[1].email} i = {robots0[1].id}/>
   <Card n={robots[2].name} e = {robots[2].email} i = {robots0[2].id}/>
   <Card n={robots[3].name} e = {robots[3].email} i = {robots0[3].id}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
